import React, { useState } from 'react';
import './App.css';

function TodoList() {

  return (
    <nav class="navbar">
      <a href="#home">home</a>
      <a href="#about">about</a>
      <a href="#menu">menu</a>
      <a href="#products">products</a>
      <a href="#review">review</a>
      <a href="#contact">contact</a>
      <a href="#blogs">blogs</a>
    </nav>
  );
}

function TodoItem({ task, onDelete }) {
  return (
    <img 
    src='https://images.rawpixel.com/image_png_800/cHJpdmF0ZS9sci9pbWFnZXMvd2Vic2l0ZS8yMDIzLTA4L3Jhd3BpeGVsX29mZmljZV8xMl9waG90b19vZl9uZXdfeW9ya19jaGVlc2VfY2FrZV9pc29sYXRlZF9vbl9hX18yNjlhZTZmNy1hMTZiLTQ5YjAtYThlOC1lODFkZDA3ODFhMzYucG5n.png' />
  );
}

function App() {
  return (
    <div className="App">
      <TodoList />
    </div>
  );
}

export default App;
